    companyProfile: "河北建设集团前身为中央轻工业部东北工程公司(1952年成立)和纺织工业部华北纺织管理局第一建筑安装工程公司(1953年成立)，这两支中央部属企业于1964年合并后更名为建筑工程部华北工程管理局第二建筑工程公司，1997年组建为河北建设集团有限公司，2017年更名为河北建设集团股份有限公司，并于2017年12月15日在香港H股主板成功上市。注册资金13亿元，中国企业500强(2018年位列376位)，中国承包商80强(2018年位列18 位)。河北建设集团是建筑工程施工总承包为主项跨行业的特级资质企业，可承接房屋建筑、公路、铁路、市政公用、港口与航道、水利水电、各类别工程的施工总承包、工程总承包和项目管理业务。同时具备建筑工程设计甲级、人防工程设计甲级资质、房地产开发壹级资质，对外援助成套项目和对外劳务合作经营资格等。河北建设集团现有员工6632人，大学本科人员比例达63%，享受政府津贴专家7人，博士、硕士147人；公司有职称人员比例约80%，其中高级及以上职称员工占11%；公司各类注册人员2862人，其中一级注册建造师1683人。河北建设集团依靠雄厚的管理优势、技术优势和为业主的综合服务能力，在京、津、冀等全国境内31个省、市、自治区承揽了大量的“高、大、精、尖、特”等千余项国家和地方重点项目，坚持塑造建筑业国际品牌，在后承接了斐济、安哥拉、摩尔多瓦等十几个国家的海外项目建设。2018年实现产值487.5亿元，市场承接额727.25亿元，纳税12.05亿。具有强大的投融资实力，银行授信额近800亿元。以BOT、BT、PPP方式先后投资建设定州污水处理厂、保定市、邢台市及所辖县内的十四个县的南水北调配套水厂、保定市生态园、唐山海港区西区基础设施、雄安新区白洋淀高铁站前广场、国道G102线秦皇岛市区段改建工程、亳州市谯城区“2017-2018年改善农村人居环境”、四川省犍为县芭石独立工矿区新型工业基地孝姑核心区“一纵两横”道路及配套管网工程等几十项重点工程，投资总额超200亿元。先后开发了格林漫都、红山庄园、张家口兰顿庄园等几十个住宅小区。铸造时代精品，河北建设集团累计荣获主承建22项鲁班奖，参建12项鲁班奖。2012年荣获首届“创建鲁班奖工程突出贡献奖金奖”。白塔机场航站楼荣获“新中国成立60周年100项经典暨精品工程”，2010年喜捧“全国质量奖”，2012年再获“河北省政府质量奖”。 河北建设集团先后获国家优质工程奖、钢结构金奖、安装之星奖、全国装饰奖、各类省优工程500多项，省级以上安全文明工地300余项。坚持科技进步，创建绿色建筑，助推传统建筑业转型升级，获首批“国家装配式建筑产业基地”，河北建设集团发起与天津大学等八家单位联合成立“京津冀建筑产业现代化联盟”，鼎力打造产、学、研、用一条龙研发模式，项目BIM技术研究应用跻身行业先进水平。2018年又获批国家企业技术中心、国家博士后工作站、院士工作站，加入了中国科学院产业转化联盟，搭建起了较高的科技平台。2011年获国家科技进步二等奖，荣获3项詹天佑奖，主参编、审查各类标准、规范44项，获得国家专利197项，完成国家级工法10项，省级工法133项，获得省部级科技进步奖12项，省建设系统科技进步奖186项。河北建设集团坚持和发扬“做有思想的企业，做有人格的法人”的企业精神，坚守“诚信为本、操守为重”的法人人格，努力践行“用爱，创造空间”的使命，坚持“追求超越、奉献真诚、组织无界、共创价值”的核心价值观，全力打造“达人达己的幸福企业，基业常青的百年老店”，不断提高为客户服务的能力，在社会和广大客户的支持下，实现了快速发展，先后荣获“国家级守合同重信用企业”、“全国模范职工之家”、“全国五一劳动奖状”、“全国用户满意企业”、“全国优秀施工企业”、“全国工程建设管理先进单位”、“全国工程建设质量管理优秀企业”、“全国建筑业新技术应用先进集体”、“AAA企业信用等级”等国家级荣誉称号。",
