    companyProfile: "招商局蛇口工业区控股股份有限公司(简称“招商蛇口”)是招商局集团旗下城市综合开发运营板块的旗舰企业,中国领先的城市和园区综合开发运营服务商,目前排名《福布斯》全球上市公司2000强第348位。根据十四五战略规划,公司以综合发展为总纲,以数字化和创新为驱动力,强化区域聚焦与城市深耕、产融结合与内外协同、产业聚集与资产管理,着力构建现金牛(社区开发)、成长型(产业园区、集中商业)、平台型(招商积余)、创新型(邮轮、大健康、文化、会展、海外)、机会型(酒店、公寓、写字楼)的多元业务,形成了目标明确、主辅分级、轻重分离的综合发展业务模式。公司积极打造产业园区、集中商业、招商积余及邮轮等四大核心IP,力争综合发展取得显著成效,形成结构优化的业态组合,打造全生命周期的产品与服务。其中,“社区开发与运营”板块重点聚焦精品住宅开发与运营。住宅产品类型涉及别墅、高端住宅、高层公寓、花园洋房等产品,目前已形成了玺系、雍系、臻系、依系等产品系列,充分满足不同客户对产品和档次的需求。“园区开发与运营”板块重点聚焦空间规划、产业聚集、生态圈服务,为产业创新赋能,主动融入国家“十四五”战略,把国家所需、招商所能紧密结合,引领各园区所在片区的产业升级、消费升级、城市升级。同时大力发展持有商业,着重培养大健康、酒店、公寓、会展、文化及物业管理等多元业态发展。产业园区业务立足蛇口样板园区的升级改造,在全国范围内布局网谷、意库、智慧城三大产品线以及各类科技园,截至2020年,运营及规划面积475万平方米。同时,公司还在国内多个城市打造特色产业新城,规划及合作开发面积468平方公里。商办持有类业务进入蓬勃发展期,集中商业包含海上世界、花园系产品,筑造缤纷场景、满足城市居民多元需求。酒店业务自建“伊敦”和“伊敦睿选”两个子品牌,同时涵盖国际品牌酒店、服务式公寓和社区精品商业。公寓业务拥有“壹”系列产品(壹棠服务式公寓、壹间精品公寓和壹栈人才公寓),为青年白领、城市精英和高端商务客群提供全周期租住解决方案。医养业务主要负责精品专科医院、中高端养老、企业健康管理及智慧社区健康等,目前美伦健康中心已在深圳、乌镇、启东、滨江等四地落地运营;养老业务产品线涵盖中高端养护院、护理院、活力老年公寓,已有“招商观颐”、“招商高利泽”两个养老品牌,进驻广州、深圳、武汉、杭州四个城市。会展业务已打造出标杆产品——“深圳国际会展中心”,目前是全球最大的会展中心,集展览、会议、活动(赛事、演艺等)、餐饮、购物、办公、服务等于一体,构建片区发展新引擎,对提升城市功能和形象、促进城市的现代化、国际化和创新发展有重要的意义。文化业务已探索发展出“文化+艺术、文化+演艺、文化+教育、文化+科技、文化+传媒”等五条产品线,聚焦落地文化IP的孵化打造和文化场馆运营能力,丰富社区居民的精神文化生活。公司积极打造央企物业管理旗舰企业——“招商积余”(股票代码001914),以“大物业”+“大资管”为核心主业,打造“国内领先的物业资产管理运营商”。“邮轮产业建设与运营”板块采取港船联动的发展策略,以港为基础、以船为纽带,构建“1+3+N”(港+船+生态)的业务体系。“港”指的是邮轮港口业务(招商邮轮母港);“船”包含了海上高端旅游业务(招商维京游轮)+海上生活方式业务(招商微游轮)+海上交通干线(招商客轮)业务;“生态”包含了免税、邮轮船供等衍生业务。通过“船、港、城、游、购、娱”一体化运营,打通邮轮全产业链,打造泛邮轮产业生态圈,成为招商蛇口综合发展模式的鲜明特色与核心竞争力。目前招商局集团以独资、参股或联合开发的形式在深圳、上海、天津、厦门、湛江、大连、南通等中国沿海和沿江城市初步完成邮轮母港布局,是中国最大的邮轮港口运营商。2016年-2020年,招商局旗下港口邮轮靠泊累计3088艘次,出入境邮轮旅客累计1620万人次,累计旅客量全国占比86%。公司致力于成为“美好生活承载者”,为城市发展与产业升级提供综合性的解决方案,同时积极响应国家一带一路的发展倡议,参与中国以及“一带一路”重要节点的城市化建设。截至2021年06月底,公司总资产规模8296.64亿元,业绩位列行业第七,全业务覆盖全球超110个城市和地区,开发精品项目超620个,服务千万客户。",
    businessScope: "城区、园区、社区的投资、开发建设和运营；交通运输、工业制造、金融保险、对外贸易、旅游、酒店和其他各类企业的投资和管理；邮轮母港及配套设施的建设和运营；房地产开发经营；水陆建筑工程；所属企业产品的销售和所需设备、原材料、零配件的供应和销售；举办体育比赛；物业管理；水上运输，码头、仓储服务；科研技术服务；提供与上述业务有关的技术、经营咨询和技术、信息服务。(依法须经批准的项目，经相关部门批准后方可开展经营活动)",
